style_sheet = '''

:root,
::backdrop {
  /* Set sans-serif & mono fonts */
  --sans-font: -apple-system, BlinkMacSystemFont, "Avenir Next", Avenir,
    "Nimbus Sans L", Roboto, "Noto Sans", "Segoe UI", Arial, Helvetica,
    "Helvetica Neue", sans-serif;

  --standard-border-radius: 5px;

  --text #111a1a;
  --blue: #2C5274;
  --green: #6DB794;
  --tab-grey-bg: #E1E5EB;
  --bg: #fff;
  --border: #898EA4;
}

/* Reset box-sizing */
*, *::before, *::after {
  box-sizing: border-box;
}

/* Reset default appearance */
textarea,
select,
input,
progress {
  appearance: none;
  -webkit-appearance: none;
  -moz-appearance: none;
}

html {
  /* Set the font globally */
  font-family: var(--sans-font);
  scroll-behavior: smooth;
}

/* Make the body a nice central block */
body {
  color: var(--text);
  background-color: var(--bg);
  font-size: 0.9rem;
  line-height: 1.4;

}

body > * {
  grid-column: 2;
}

/* override styles when printing */
@media print {
  body {
    font-size: 0.9rem;
  }
}

/* Add a little padding to ensure spacing is correct between content and header > nav */
main {
  padding-top: 1.5rem;
}

body > footer {
  margin-top: 4rem;
  padding: 2rem 1rem 1.5rem 1rem;
  color: var(--text-light);
  font-size: 0.9rem;
  text-align: center;
  border-top: 1px solid var(--border);
}

/* Format headers */
h1 {
  color: var(--blue);
  font-size: 2rem;
}

h2 {
  color: var(--blue);
  font-size: 1.5rem;
  margin-top: 0.1rem;
}

h3 {
  color: var(--blue);
  font-size: 1.5rem;
  margin-top: 0.05rem;
}

h4 {
  color: var(--blue);
  font-size: 1.4rem;
}

h5 {
  color: var(--blue);
  font-size: 1.1rem;
}

h6 {
  color: var(--blue);
  font-size: 0.9rem;
}

p {
  margin-top: 0.1rem 0;
}

/* Prevent long strings from overflowing container */
p, h1, h2, h3, h4, h5, h6 {
  overflow-wrap: break-word;
}

/* Fix line height when title wraps */
h1,
h2,
h3 {
  line-height: 0.3;
}

/* Format tables */
table {
  border-collapse: collapse;
  margin: 1.5rem 0;
}

td,
th {
  border: 1px solid var(--border);
  text-align: start;
  padding: 0.4rem;
}

th {
  background-color: var(--tab-grey-bg);
}

table caption {
  margin-bottom: 0.5rem;
}

/* Misc body elements */
hr {
  border: none;
  height: 2px;
  background: var(--blue);
  color: var(--blue);
  margin: 1rem auto;
}

@media print {
    hr {
      border: 2px solid;
      height: 2px;
      background: var(--blue);
      color: var(--blue);
      margin: 1rem auto;
    }
}

div[style*="flex"] {
  align-items: baseline;
}


'''


